import {React,useEffect, useState} from 'react';
import '../../App.css';
import {Route, Redirect, useHistory} from 'react-router-dom'
import Modal from 'react-modal';
import { useForm } from "react-hook-form";
import { login, createUser } from "../../functions/users";

/*Signed up successfully modal style*/
const customStyles = {
    content : {
      top                   : '50%',
      left                  : '50%',
      right                 : 'auto',
      bottom                : 'auto',
      marginRight           : '-50%',
      transform             : 'translate(-50%, -50%)',
      backgroundColor       : "#d3f1ef",
      position              : "fixed",
      width: "300px",
      height: "100px",
    }
  };


function Signuppre() {

    const history = useHistory();
    const [modalIsOpen,setIsOpen] = useState(false);
    const [username, setUsername] = useState("");
    
    const { register, handleSubmit } = useForm();
    const onSubmit = async (data) => {
      var reponse = await createUser(data);
      console.log(reponse);
    };

  function Redirect(page){
    history.push("/"+page);
    return <Redirect    to={{
      pathname:'/'+page
        }}/>
  }

  function openModal(){
    setIsOpen(true);
  }

  function closeModal(){
    setIsOpen(false);
  }


  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        flexDirection: "center",
        flexDirection: "column",
      }}
    >
      <div
        style={{
          display: "flex",
          flexDirection: "center",
          flexDirection: "column",
        }}
      >
        <div style={{margin: '25px 0'}}>Sign In</div>
        <div style={{border: '1px solid', padding: '15px'}}>
          <form onSubmit={handleSubmit(onSubmit)}>
            <div style={{margin: '25px 0',display: 'flex',flexDirection:'row'}}>
                <div style={{width: '100px'}}>Username</div>
                <div> <input type="text" {...register("username")} /></div>
              
             
            </div>
            <div style={{margin: '25px 0',display: 'flex',flexDirection:'row'}}>
              
              <div style={{width: '100px'}}>Password</div>
              <div><input {...register("password")} type="password" /></div>
            </div>

            <input type="submit" />
          </form>
        </div>
      </div>
    </div>
  );
}

export default Signuppre;
